import { cleanup } from "./pure.js";
export * from "./pure.js";
if ('undefined' == typeof process || 'true' !== process.env.PTL_SKIP_AUTO_CLEANUP) {
    if ('function' == typeof afterEach) afterEach(()=>{
        cleanup();
        lynxTestingEnv.reset();
    });
    else if ('function' == typeof teardown) teardown(()=>{
        cleanup();
        lynxTestingEnv.reset();
    });
}
